import React from "react";
import "./style.scss";

function Stastep() {
  return (
    <div className="stastep">
      <div className="stastep-title">
        <div className="stastep-container">
          <div className="stastep-title-tag"></div>
          <div className="stastep-title-left">
            3 Step use for Fashionista<br></br> earn easily at home
          </div>
        </div>
      </div>
      <div className="stastep-step1"></div>
    </div>
  );
}

export default Stastep;
